import React from 'react';
import { useQuery, useMutation, gql } from '@apollo/client';
import PromptItem from './PromptItem';

const GET_PROMPTS = gql`
    query {
        prompts {
            chatId
            prompt
            response
            chatTitle
            createdAt
        }
    }
`;

const DELETE_PROMPT = gql`
    mutation DeletePrompt($chatId: String!) {
        deletePrompt(chatId: $chatId) {
            chatId
        }
    }
`;

function PromptList() {
    const { loading, error, data } = useQuery(GET_PROMPTS);
    const [deletePrompt] = useMutation(DELETE_PROMPT);

    if (loading) return <p>Loading...</p>;
    if (error) return <p>Error: {error.message}</p>;

    return (
        <div>
            {data.prompts.map((prompt) => (
                <div key={prompt.chatId} className="prompt-item">
                    <h3>{prompt.chatTitle}</h3>
                    <p>{prompt.prompt}</p>
                    <p><strong>Response:</strong> {prompt.response}</p>
                    <p><small>Created At: {prompt.createdAt}</small></p>
                    <button onClick={() => deletePrompt({ variables: { chatId: prompt.chatId } })}>Delete</button>
                </div>
            ))}
        </div>
    );
}

export default PromptList;
